window.bookSummaryJSON = "<p>From the first night I bedded her, I knew I was playing with fire. And now I must face the consequences.</p> <p>I betrayed my best friend. A man who was more a brother to me than my own blood. </p> <p>And now I fear I have lost her too. </p> <p>She claims men hold all the power in our world, but she has brought me to my knees. I love her. I know that now. Too little too late. </p> <p>Breaking a heart is easy. Mending one is more complicated. </p> <p>But a predator lies in wait of her. And I’ll do anything I must to keep her safe.</p>"; 
